import tkinter as tk
from tkinter import ttk
import requests
import matplotlib.pyplot as plt
from matplotlib.backends.backend_tkagg import FigureCanvasTkAgg
from matplotlib.figure import Figure
import base64
import os

# 发送API请求获取天气数据
api = "https://devapi.qweather.com/v7/weather/7d?location=101050101&key=e0329634a085422e9a86be4c5f5db40b&lang=zh"
weather = requests.get(api).json()
plt.rcParams['font.family'] = 'Microsoft YaHei'

# 创建主窗口
root = tk.Tk()
root.title("近7日天气预报")
tmp = open("tmp.ico", "wb+")
tmp.write(base64.b64decode(''))
tmp.close()
root.iconbitmap("tmp.ico")
os.remove("tmp.ico")

# 创建选项卡
tab_control = ttk.Notebook(root)

# 创建选项卡1
tab1 = ttk.Frame(tab_control)
tab_control.add(tab1, text="气温")

# 在气温中创建图形
fig1 = Figure(figsize=(10, 6), dpi=100)
ax1 = fig1.add_subplot(111)

# 获取需要绘制的数据
dates = [data['fxDate'] for data in weather['daily']]
tempMax = [int(data['tempMax']) for data in weather['daily']]
tempMin = [int(data['tempMin']) for data in weather['daily']]

# 创建折线图
ax1.plot(dates, tempMax, label='最高温度')
ax1.plot(dates, tempMin, label='最低温度')

# 在每个折点上添加温度标签
for i in range(len(dates)):
    ax1.text(dates[i], tempMax[i], str(tempMax[i]) + '°C', ha='center', va='bottom')
    ax1.text(dates[i], tempMin[i], str(tempMin[i]) + '°C', ha='center', va='top')

# 设置标题和坐标轴标签
ax1.set_title('温度')
ax1.set_xlabel('日期')
ax1.set_ylabel('温度（℃）')

# 添加图例
ax1.legend()

# 创建图形画布并将其放置在选项卡1中
canvas1 = FigureCanvasTkAgg(fig1, master=tab1)
canvas1.draw()
canvas1.get_tk_widget().pack()

