import datetime

# 创建选项卡7
tab7 = ttk.Frame(tab_control)
tab_control.add(tab7, text="天气状况")

# 创建表格
table = ttk.Treeview(tab7, columns=("日期", "白天", "夜晚", "月相"), show="headings")
table.heading("日期", text="日期")
table.heading("白天", text="白天")
table.heading("夜晚", text="夜晚")
table.heading("月相", text="月相")

# 设置表格样式
style = ttk.Style()
style.configure("Treeview")

# 解析返回的数据并填充到表格中
for daily_data in weather['daily']:
    date = daily_data['fxDate']
    day_weather = daily_data['textDay']
    night_weather = daily_data['textNight']
    moon_phase = daily_data['moonPhase']
    table.insert("", "end", values=(date, day_weather, night_weather, moon_phase))


# 显示表格
table.pack(fill="both", expand=True)

# 创建选项卡8
tab8 = ttk.Frame(tab_control)
tab_control.add(tab8, text="日月出落时间")

# 在日月出落时间中创建图形
fig8 = Figure(figsize=(10, 6), dpi=100)
ax8 = fig8.add_subplot(111)

# 获取需要绘制的数据
dates = [data['fxDate'] for data in weather['daily']]
sunrise = [str(data['sunrise']) for data in weather['daily']]
sunset = [str(data['sunset']) for data in weather['daily']]
moonrise = [str(data['moonrise']) for data in weather['daily']]
moonset = [str(data['moonset']) for data in weather['daily']]

# 创建折线图
ax8.plot(dates, sunset, label='日落时间')
ax8.plot(dates, sunrise, label='日出时间')
ax8.plot(dates, moonset, label='月落时间')
ax8.plot(dates, moonrise, label='月出时间')

# 在每个折点上添加时间标签
for i in range(len(dates)):
    ax8.text(dates[i], sunset[i], str(sunset[i]), ha='center', va='top')
    ax8.text(dates[i], sunrise[i], str(sunrise[i]), ha='center', va='bottom')
    ax8.text(dates[i], moonset[i], str(moonset[i]), ha='center', va='top')
    ax8.text(dates[i], moonrise[i], str(moonrise[i]), ha='center', va='bottom')

# 设置标题和坐标轴标签
ax8.set_title('日月出落时间')
ax8.set_xlabel('日期')
ax8.set_ylabel('时间')

# 添加图例
ax8.legend()

# 创建图形画布并将其放置在选项卡8中
